  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The CMS IPBS PUFs are aggregated files
  in which each record summarizes information for a particular institutional provider.
  An institutional provider refers to a hospital, a critical care facility, a skilled
  nursing facility, a home health agency or hospice or another similar institution
  providing services to Medicare beneficiaries. Information about individual beneficiaries
  is not reported.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
